            title : 'lavender',
        },
        {
            id : 10,
            url : lilly,
            title : 'lilly',
        },
        {
            id : 11,
            url : sunflower,
            title : 'sunflower',
        },
        {
            id : 12,
            url : tulip,
            title : 'tulip',
        },     
]
const countRef = useRef(0);
const [count, setCount] = useState(0);

const handleClick = () =>{
    countRef.current += 1;
    setCount(countRef.current)
}


  return (
    <Fragment>
             <div className='mt-5 mb-5 flex justify-end'>Click Counter : {count}</div>
            <div className='black grid imageGrid m-[50px] gap-5' onClick={handleClick}>
            {
                imageCollection.map((item,i) =>{
                   return(
                    <div className="flex justify-center border rounded-sm  p-5 cursor-pointer" key={i}>     
                        <img className="h-[150px]" src={item.url}></img>               
                    </div>
                   )
                })
            }
        </div>
    </Fragment>

  )
}
